(32, 18, '2009-01-23 16:17:37', 0.00, 'In precompiled user scenarios geht nur das setup script. eval & cleanup werden nicht mit variablen gefÃ¼llt.', 0, 0),
(30, 15, '2009-01-26 10:51:11', 0.00, 'Bei diesem bug ging es darum, dass es Spielern nicht klar ist, warum man auf dem Rechner, auf dem man sich eh einloggen kann, eine backdoor installieren soll.\nWenn man das im Szenario Ã¤ndern will, mÃ¼sste man noch einen weiteren Rechner verwenden, in den man sich dann noch erst reinhacken mÃ¼sste.\nDaher schlage ich vor, das in der Story anzugleichen. Also entweder die backdoor fÃ¼r den "Auftraggeber" hinterlassen lassen (falls das schon so ist, vielleicht deutlicher drauf hinweisen?) oder erzÃ¤hlen, dass der Zugang vielleicht gesperrt werden soll, aber man unbedingt noch drauf kÃ¶nnen muss.', 0, 0),
(33, 3, '2009-01-26 10:59:03', 0.00, 'check Routing swxCakePhp\nLappi-Version Beta', 0, 0),
(31, 15, '2009-01-26 10:59:57', 0.00, 'Es ist unklar, warum der Spieler nach dem Installieren der backdoor sich noch Ã¼ber die backdoor verbinden muss, damit der Szenario bestanden ist.\nEs steht zwar dort als Punkt 3, aber es ist von der Story her sinnlos, sich auf die backdoor auf dem localhost zu verbinden. Dadurch hat man nichts gewonnen.\n\nVielleicht den Szenario so anpassen, dass es nur Ã¼berprÃ¼ft wird, ob die backdoor auf dem Rechner auf dem richtigen port installiert ist?', 0, 0),
