(26, 15, '2009-01-27 23:52:52', 0.00, 'Durch SQL injection im Passwortfeld soll das Szenario auch zu lÃ¶sen sein.\n\nMuss geprÃ¼ft werden, ob das so in Ordnung ist. Eigentlich sollte die Passwortabfrage umgangen werden. Wenn erst im Passwortfeld injected wird, dÃ¼rfte nach meinem jetzigen VerstÃ¤ndnis die Passwortabfrage nicht umgangen werden.', 0, 0),
