(40, 15, '2009-02-17 23:45:02', 0.00, 'Find liefert 2 Ergebnisse, wenn die Datei in einem Ordner liegt, der\naus einem anderen Ordner per symlink verlinkt wurde\n\n- ----schnipp----\n014f@PC33:~$ grep -lsr SUCHBEGRIFF /var/\n/var/spool/mail/tester\n/var/mail/tester\n014f@PC33:~$ cd /var/spool/\n014f@PC33:/var/spool$ ls -l mail\nlrwxrwxrwx 1 root root 7 2008-10-28 17:01 mail -> ../mail\n- ----schnapp----\n\nDa sollte der Szenario vermutlich so angepasst werden, dass immer nur ein Ergebnis geliefert wird. Der Spieler wird sonst zu leicht unsicher.', 0, 0),
(41, 15, '2009-02-17 23:51:31', 0.00, 'Es scheint so, als wenn, nach erfolgreichem Abschluss des Szenarios auf "I have completed..." geklickt wird, ein Skript den Ordner "/var/www/nets-x" lÃ¶scht und damit das Spiel nicht mehr spielbar ist.\n\nEs ist zu prÃ¼fen, ob der Ordner wirklich durch das Skript gelÃ¶scht wird oder wie der Ordner sonst verschwinden konnte. \nGgf. dann das Skript korrigieren.', 0, 0),
