(51, 12, '2009-02-24 01:59:24', 0.00, 'AbschlieÃŸen des Nmap-Szenarios fÃ¼hrt zu Olga''s Aussage, dass man einen hÃ¶heren access level erreicht hÃ¤tte. Dieser Level scheint sich aber nicht auszuwirken. Die red, blue, yellow, white und black doors sind immer noch gesperrt. Das ist verwirrend! \n\nAbgesehen davon sind die doppelten Laserschranken vor den beiden RÃ¤umen unnÃ¶tig. Was bringt es einem, wenn man die erste Schranke freigeschaltet hat, man aber immer noch von der zweiten Schranke aufgehalten wird. Eine Schranke pro Raum sollte genÃ¼gen. KÃ¶nnen das ja auch Mittwoch nochmal diskutieren.', 0, 0),
