(54, 12, '2009-02-24 02:03:59', 0.00, 'Der Text von State ID=5 stimmt nicht, das Gen Lab ist nicht auf der rechten Seite von dem Corridor - wenn, dann links. Die Beschreibung ist aber sowieso sehr unglÃ¼cklich. Man steht mitten in dem groÃŸen Raum und soll dann "down the corridor" (den Flur entlang) gehen. Und die Richtung soll dann geraten werden? ;-) \nBesser wÃ¤re es, wenn er etwas sagen wÃ¼rde wie "You will find him in the Gen Lab. It''s near the elevator hall/corridor". Das gilt auch fÃ¼r die Wegbeschreibung von Agent Schuhmacher zur Mistress.', 0, 0),
(55, 12, '2009-02-24 02:04:37', 0.00, 'Teppich bei der Mistress muss eine Kachel tiefer gezogen werden', 0, 0),
(45, 12, '2009-02-24 22:11:16', 0.00, 'Name war falsch. Labassistent Heins sollte es heiÃŸen. Jetzt passt es auch mit der Weiblichkeit.', 0, 0),
