(56, 19, '2009-02-27 10:50:05', 0.00, 'nach dem szenario fÃ¼r das genlabor sollte man zu sir calle und ihm wegen der backdoor bescheid geben. ansonsten waren alle szenarien schon vorher fertig, auÃŸer cron john (und directory traversal). ich bon aber nicht zu sir calle gegangen, sondern zu der mistress, die mir dann das szenario directory traversal gibt, was ihc lÃ¶se. dann sagt die mistress mir, dass ich fertig bin und zu einem neuen floor gehen kann. \nim anschluss gehe ich dann nochmal zu sir calle und agent schumacher gibt mir dann das szenario cron john, sagt aber noch ganz normal, ich kÃ¶nne erst zur mistress, wenn ich das szenario gelÃ¶st habe...', 0, 0),
(57, 19, '2009-02-27 11:01:42', 0.00, '(ich war erst bei dr- von bothmer, habe den job abgelehnt, dann bei olga und habe die jobs abgelehnt) dann wieder bei dr. von bothmer, habe den job "hydra" angenommen, dann aber nicht gelÃ¶st, sondern bin wieder zu olga gegangen, die mir wieder BEIDE jobs, also hydra und nmap gibt, obwohl ihc den ja schon habe. als login bleibt aber weiterhin der account von DrVonBothmer_eigenerName', 0, 0),
(58, 19, '2009-02-27 11:06:34', 0.00, 'nachdem das szenario hydra gelÃ¶st ist, spricht man olga an und die sagt "... I need access to HIS computer..." da wÃ¤re es besser "Dr. Von Bothmer" zu schreiben, oder am besten auch noch eine kurze begrÃ¼ndung dazu, sonst ist der bezug unklar', 0, 0),
(57, 19, '2009-02-27 11:10:30', 0.00, 'nachdem ich nmap und hydra gelÃ¶st habe, sagt olga dann auch noch, dass sie mir ein szenario gegeben hat, obwohl ich kein neues bekommen habe (vllt weil ich "drei" szenarien bekommen habe, aber nur "zwei" gelÃ¶st habe?) und wenn ich dann zu dr. von bothmer gehe, lobt der mich fÃ¼r den guten job, also wird das hydra szenario ihm zugeordnet und nicht olga?', 0, 0),
(59, 19, '2009-02-27 11:13:29', 0.00, 'das blutige fleisch, das da im lbor rumliegt, ist ziemlich unpassend fÃ¼r ein genlabor... GEN-labor und kein schlachthaus...', 0, 0),
(60, 19, '2009-02-27 11:18:12', 0.00, 'dass man das szenario john the ripper von laborassistent heins bekommt hat Ã¼berhaupt keinen bezug zur story sondern ist einfach zufÃ¤llig, dass man die anspricht. auÃŸerdem erklÃ¤rt sie nicht, was das soll, oder wofÃ¼r der job gut ist, sondern sagt einfach nur, dass es da ein neues tool gibt.\ndas ist bei agent pearse so Ã¤hnlich, da fehlt auch so ein bisschen der bezug...', 0, 0),
(61, 19, '2009-03-12 14:03:04', 0.00, 'ich habe als erstes mit olga gesprochen, aber job abgelehnt\nich habe dann hydra von dr. von bothmer bekommen und gelÃ¶st und bin dann wieder zu olga gegangen und sie hat mich gefragt, ob ich\n-den einen job\n-den anderen job-\n-beide jobs\n-oder keinen \n(ich glaub, dass es dieser mÃ¶glichkeiten waren, so ungefÃ¤hr jedenfalls, auf jeden fall vier antwortmÃ¶glichkeiten)\nwenn man sagt "beide jobs" kriegt man beide, kann nmap noch lÃ¶sen und das spiel geht normal weiter, aber olga sagt die ganze zeit, dass man seinen job tun soll.\nwenn man als antwort gibt, dass man ihr gegen den dr. helfen mÃ¶chte, kommt wieder das skill freigeschaltet-ding. olga sagt dann die ganze zeit, man solle das lÃ¶sen. hydra nochmal spielen Ã¤ndert nichts an der situation. dadurch bekommt man aber das szenario nmap nicht mehr und kann das level nicht beenden, weil die mistress einem nicht das letzte szenario gibt, weil ja nicht alle gespielt wurden.', 0, 0),
(62, 19, '2009-03-17 10:57:54', 0.00, 'ich habe das szenario hydra von dr. von bothmer bekommen und gespielt, dann zu olga gegangen (sie stellt dann eh schon die falsche frage, weil sie ja  hydra nochmal anbietet). ich nehme dann aber nur nmap an. nachdem das gespielt war, fragte olga wieder, ob ich noch einen job mÃ¶chte, eben hydra, obwohl das ja schon gespielt war', 0, 0),
(63, 19, '2009-03-17 11:08:19', 0.00, 'es ist mÃ¶glich, das szenario cron john vor dem szenario john the ripper zu spielen, was eigentlich nicht sein sollte, weil cron john auf john the ripper aufbaut. in meinem fall war das so mÃ¶glich:\nbekomme hydra von dr. von bothmer und lÃ¶se das\ngehe zu heins und bekomme szenario john the ripper (lÃ¶se es aber nicht)\ngehe zu olga und lasse mir nmap geben (lÃ¶se es aber nicht)\ngehe zu agent pearse und lasse mir sql injection geben und lÃ¶se es\n   (das ist auch noch ein fehler, dass man so viele szenarien bekommen kann,ohne die zu lÃ¶sen)\nlÃ¶se nmap\ngehe ins genlab, kriege backdoor und lÃ¶se es\nkriege cron john von schuhmacher und kann es somit vor john the ripper spielen', 0, 0);
